0%BA%D0%B0%D1%8F_%D1%83%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u044c\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0443\u043d\u0438\u044f\">\u0441\u043e\u044e\u0437 \u0441 \u0414\u0430\u043d\u0438\u0435\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1654_%D0%B3%D0%BE%D0%B4\" title=\"1654 \u0433\u043e\u0434\">1654<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%BD%D0%B0_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B0_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8)\" title=\"\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430 (\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u0428\u0432\u0435\u0446\u0438\u0438)\">\u041a\u0440\u0438\u0441\u0442\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B9_%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D0%B8\" title=\"\u0421\u043f\u0438\u0441\u043e\u043a \u043a\u043e\u0440\u043e\u043b\u0435\u0439 \u0428\u0432\u0435\u0446\u0438\u0438\">\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u0428\u0432\u0435\u0434\u043e\u0432, \u0413\u043e\u0442\u043e\u0432 \u0438 \u0412\u0435\u043d\u0434\u043e\u0432<\/a> \u043e\u0442\u0440\u0435\u043a\u043b\u0430\u0441\u044c \u043e\u0442 \u043a\u043e\u0440\u043e\u043d\u044b \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 \u0434\u0432\u043e\u044e\u0440\u043e\u0434\u043d\u043e\u0433\u043e \u0431\u0440\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_X_%D0%93%D1%83%D1%81%D1%82%D0%B0%D0%B2\" title=\"\u041a\u0430\u0440\u043b X \u0413\u0443\u0441\u0442\u0430\u0432\">\u041a\u0430\u0440\u043b X \u0413\u0443\u0441\u0442\u0430\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1664_%D0%B3%D0%BE%D0%B4\" title=\"1664 \u0433\u043e\u0434\">1664<\/a>&#160;\u2014 \u041d\u043e\u0432\u044b\u0439 \u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1674_%D0%B3%D0%BE%D0%B4\" title=\"1674 \u0433\u043e\u0434\">1674<\/a>&#160;\u2014 \u043a\u043e\u0440\u043e\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B8%D0%B2%D0%B0%D0%B4%D0%B6%D0%B8\" title=\"\u0428\u0438\u0432\u0430\u0434\u0436\u0438\">\u0428\u0438\u0432\u0430\u0434\u0436\u0438<\/a>, \u0441\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%BC%D0%B0%D1%80%D0%B0%D1%82%D1%85%D0%BE%D0%B2\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u043c\u0430\u0440\u0430\u0442\u0445\u043e\u0432\">\u041c\u0430\u0440\u0430\u0442\u0445\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1761_%D0%B3%D0%BE%D0%B4\" title=\"1761 \u0433\u043e\u0434\">1761<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BC%D0%BE%D0%BD%D0%BE%D1%81%D0%BE%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u043e\u043c\u043e\u043d\u043e\u0441\u043e\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u041c.&#160;\u0412.&#160;\u041b\u043e\u043c\u043e\u043d\u043e\u0441\u043e\u0432<\/a>, \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%85%D0%BE%D0%B6%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%D0%92%D0%B5%D0%BD%D0%B5%D1%80%D1%8B_%D0%BF%D0%BE_%D0%B4%D0%B8%D1%81%D0%BA%D1%83_%D0%A1%D0%BE%D0%BB%D0%BD%D1%86%D0%B0\" title=\"\u041f\u0440\u043e\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0412\u0435\u043d\u0435\u0440\u044b \u043f\u043e \u0434\u0438\u0441\u043a\u0443 \u0421\u043e\u043b\u043d\u0446\u0430\">\u043f\u0440\u043e\u0445\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0412\u0435\u043d\u0435\u0440\u044b \u043f\u043e \u0441\u043e\u043b\u043d\u0435\u0447\u043d\u043e\u043c\u0443 \u0434\u0438\u0441\u043a\u0443<\/a>, \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0438\u043b \u043d\u0430\u043b\u0438\u0447\u0438\u0435 \u0443 \u043d\u0435\u0451 \u0430\u0442\u043c\u043e\u0441\u0444\u0435\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1801_%D0%B3%D0%BE%D0%B4\" title=\"1801 \u0433\u043e\u0434\">1801<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B4%D0%B0%D1%85%D0%BE%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0411\u0430\u0434\u0430\u0445\u043e\u0441\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0411\u0430\u0434\u0430\u0445\u043e\u0441\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BF%D0%B5%D0%BB%D1%8C%D1%81%D0%B8%D0%BD%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u043f\u0435\u043b\u044c\u0441\u0438\u043d\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u043f\u0435\u043b\u044c\u0441\u0438\u043d\u043e\u0432\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1808_%D0%B3%D0%BE%D0%B4\" title=\"1808 \u0433\u043e\u0434\">1808<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%BE%D0%B7%D0%B5%D1%84_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" title=\"\u0416\u043e\u0437\u0435\u0444 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u0416\u043e\u0437\u0435\u0444 \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442<\/a>, \u0431\u0440\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430 I<\/a>, \u043a\u043e\u0440\u043e\u043d\u043e\u0432\u0430\u043d \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043a\u043e\u0440\u043e\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1813_%D0%B3%D0%BE%D0%B4\" title=\"1813 \u0433\u043e\u0434\">1813<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B0%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u043d\u0433\u043b\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Stoney_Creek\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0421\u0442\u043e\u0443\u043d\u0438 \u041a\u0440\u0438\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B0%D1%83%D1%81%D1%81,_%D0%9B%D0%B5%D0%B2%D0%B8\" class=\"mw-redirect\" title=\"\u0421\u0442\u0440\u0430\u0443\u0441\u0441, \u041b\u0435\u0432\u0438\">\u041b\u0435\u0432\u0438 \u0421\u0442\u0440\u0430\u0443\u0441\u0441<\/a> \u0441\u0434\u0435\u043b\u0430\u043b \u0441\u0432\u043e\u0438 \u043f\u0435\u0440\u0432\u044b\u0435 \u0433\u043e\u043b\u0443\u0431\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%B8%D0%BD%D1%81%D1%8B\" title=\"\u0414\u0436\u0438\u043d\u0441\u044b\">\u0434\u0436\u0438\u043d\u0441\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1882_%D0%B3%D0%BE%D0%B4\" title=\"1882 \u0433\u043e\u0434\">1882<\/a><ul><li>\u0411\u043e\u043b\u0435\u0435 100 000 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BC%D0%B1%D0%B5%D0%B9\" class=\"mw-redirect\" title=\"\u0411\u043e\u043c\u0431\u0435\u0439\">\u0411\u043e\u043c\u0431\u0435\u044f<\/a> \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u043e\u0442 \u043e\u0433\u0440\u043e\u043c\u043d\u044b\u0445 \u0432\u043e\u043b\u043d, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0446\u0438\u043a\u043b\u043e\u043d \u043f\u0440\u0438\u0433\u043d\u0430\u043b \u0432 \u0433\u0430\u0432\u0430\u043d\u044c \u0441 \u0410\u0440\u0430\u0432\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0440\u044f.<\/li><li>\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0435\u0446 \u0413\u0435\u043d\u0440\u0438 \u0421\u0438\u043b\u0438 (Henry W. Seely) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D1%82%D1%8E%D0%B3\" title=\"\u0423\u0442\u044e\u0433\">\u0443\u0442\u044e\u0433<\/a>.<\/li><\/ul><\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1912_%D0%B3%D0%BE%D0%B4\" title=\"1912 \u0433\u043e\u0434\">1912<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0432\u0442\u043e\u0440\u043e\u0435 \u043f\u043e \u0432\u0435\u043b\u0438\u0447\u0438\u043d\u0435 \u0432\u0443\u043b\u043a\u0430\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0438\u0437\u0432\u0435\u0440\u0436\u0435\u043d\u0438\u0435 XX \u0432\u0435\u043a\u0430 (\u0432\u0443\u043b\u043a\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B0%D1%80%D1%83%D0%BF%D1%82%D0%B0\" title=\"\u041d\u043e\u0432\u0430\u0440\u0443\u043f\u0442\u0430\">\u041d\u043e\u0432\u0430\u0440\u0443\u043f\u0442\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8F%D1%81%D0%BA%D0%B0\" title=\"\u0410\u043b\u044f\u0441\u043a\u0430\">\u0410\u043b\u044f\u0441\u043a\u0430<\/a>, \u0438\u0437\u0432\u0435\u0440\u0433\u043d\u0443\u0432\u0448\u0438\u0439 17 \u043a\u043c\u00b3 \u043b\u0430\u0432\u044b).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a><ul><li>\u041f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0430 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%9F%D1%80%D0%B5%D0%BA%D0%BC%D1%83%D1%80%D1%8C%D0%B5\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041f\u0440\u0435\u043a\u043c\u0443\u0440\u044c\u0435\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041f\u0440\u0435\u043a\u043c\u0443\u0440\u044c\u0435<\/a> (\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BB%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0421\u043b\u043e\u0432\u0435\u043d\u0438\u044f\">\u0421\u043b\u043e\u0432\u0435\u043d\u0438\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" class=\"mw-redirect\" title=\"\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0432\u043b\u0430\u0441\u0442\u044c\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0432\u043b\u0430\u0441\u0442\u044c<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%85%D0%BD%D0%BE,_%D0%9D%D0%B5%D1%81%D1%82%D0%BE%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u0445\u043d\u043e, \u041d\u0435\u0441\u0442\u043e\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u041d\u0435\u0441\u0442\u043e\u0440\u0430 \u041c\u0430\u0445\u043d\u043e<\/a> \u0432\u043d\u0435 \u0437\u0430\u043a\u043e\u043d\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;<ul><li>\u0414\u0435\u043a\u0440\u0435\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0430 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B0%D0%B2%D0%BD%D0%BE%D0%B5_%D1%83%D0%BF%D1%80%D0%B0%D0%B2%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D0%BE_%D0%B4%D0%B5%D0%BB%D0%B0%D0%BC_%D0%BB%D0%B8%D1%82%D0%B5%D1%80%D0%B0%D1%82%D1%83%D1%80%D1%8B_%D0%B8_%D0%B8%D0%B7%D0%B4%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2\" title=\"\u0413\u043b\u0430\u0432\u043d\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u043e \u0434\u0435\u043b\u0430\u043c \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u0438 \u0438\u0437\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\">\u0413\u043b\u0430\u0432\u043d\u043e\u0435 \u0443\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435 \u043f\u043e \u0434\u0435\u043b\u0430\u043c \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0